  enum WindowFuncNulls {
    RESPECT_NULLS = 1;
    IGNORE_NULLS = 2;
  }
  required WindowFuncs func = 1;
  repeated Expr args = 2;
  optional WindowFuncNulls wfn = 3;
}

message WindowFuncCall {
  oneof window_fn_oneof {
    SQLWindowCall win_func = 1;
