    FULL = 4;
    PASTE = 5;
    CROSS = 6;
  }
  enum JoinConst {
    ANY = 1;
    ALL = 2;
    SEMI = 3;
    ANTI = 4;
    ASOF = 5;
  }
  optional bool global = 1;
  optional JoinType join_op = 2;
  optional JoinConst join_const = 3;
  required TableOrSubquery tos = 4;
  required JoinConstraint join_constraint = 5;
}

message ArrayJoin {
